import faker from "faker";
import "../styles/_main.scss"
import Nav from "./Nav";
import Body from "./Body";
import Card from "./Card";

const App = () => {
      var Movies = [{ "img": faker.random.image(), "title": "Movie 1", "blurb": "Some information about the movie here" }, { "img": faker.random.image(), "title": "Movie 2", "blurb": "Some information about the movie here" }]
      return (
            <main>
                  <Nav logo={faker.image.cats()} />
                  <Body data={Movies} />
            </main>

      )
}
export default App;
